import Header from './components/Header';
function App() {
    return (
        <>
            <DynamicTitle />
            <div class="body_wrapper">
                <Header />
                <div className="App">
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="*" element={<Error />} />
                        {/* Rotta di fallback per gestire le pagine non trovate */}
                    </Routes>
                </div>
                <Footer />
            </div>

            <a id="back-to-top" title="Back to Top"></a>
        </>
    );
}

export default App;
